import React from 'react'
import Nav from './nav';

function nav() {
    return (
      <div>
        <h3>BARBERs</h3>
       <nav className='text-white'>
          <a href="">HOME</a>
          <a href="">About Us</a>
          <a href="">Services</a>
          <a href="">Testimonials</a>
          <a href="">Our Team</a>
          <a href="">Contact Us</a>
       </nav>

      </div>
    );
  }

export default Nav
